,null,["tsg.hy","UCqQn92noBhY9VKQy4xCHPsg","Loiane Groner","Canal com aulas gratuitas sobre Java, Sencha (Ext JS e Touch), JavaScript, Angular e desenvolvimento mobile com Phonegap e Ionic.\nPara obter acesso ao fórum e certificado dos cursos: http://loiane.training\n\nOlá, faço parte das comunidades Java, Sencha, Angular e Phonegap/Ionic e participo ativamente das mesmas. Gosto de compartilhar conteúdo no youtube e no meu blog loiane.com pois acredito que a melhor forma de aprender é compartilhando conhecimento.\n\nParticipo de eventos por todo o Brasil palestrando sobre Java (inclusive no JavaOne Brasil, maior evento de Java da América Latina), Sencha, Angular e desenvolvimento mobile híbrido com Phonegap/Cordova.\n\nPublico tutoriais no meu blog também: loiane.com\n\nObrigada pela visita e espero que goste do material disponibilizado! :)","https://yt3.ggpht.com/-6uD6BoccBj0/AAAAAAAAAAI/AAAAAAAAAAA/_H4MSe5IJxQ/s88-c-k-no-mo-rj-c0xffffff/photo.jpg","//yt3.ggpht.com/bFDm0LbrLIM3OTsY6DNQjXh4UBDuK-lt4pMJKoErXk9qYrPrvdGc-ffzBU8BxauPVSyo2WhxLA\u003dw640-fcrop64\u003d1,32b75a57cd48a5a8-nd-c0xffffffff-rj-k-no",46463,1,"Loianeg",[]
